import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUserCircle, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import ArticlePage from './ArticlePage';
import VideoTutorialPage from './VideoTutorialPage';
import RecommendedBooksPage from './RecommendedBooksPage';
import CodingPracticePage from './CodingPracticePage';
import BehavioralQuestionPage from './BehavioralQuestionPage';
import CompanyResearchPage from './CompanyResearchPage';
import AdminDashboard from './AdminDashboard';
import RoadmapSection from './RoadmapSection';
import RoadmapDetailPage from './RoadmapDetailPage';
import ChatInterface from './ChatInterface';
import ResourcePage from './ResourcePage';
import Avbadmin from './Avbadmin';
import ProgressTracker from './ProgressTracker';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Profile from './pages/Profile';

const InterviewPreparationDashboard = () => {
  const [tasks, setTasks] = useState([]);
  const [reminders, setReminders] = useState([]);
  const [resources, setResources] = useState([]);
  const [progress, setProgress] = useState([]);
  const [newTask, setNewTask] = useState('');
  const [newReminder, setNewReminder] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchTasks();
    fetchReminders();
    fetchResources();
    fetchProgress();
  }, []);

  const fetchTasks = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/tasks', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTasks(response.data);
    } catch (err) {
      console.error('Error fetching tasks:', err);
    }
  };

  const fetchReminders = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/reminders', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setReminders(response.data);
    } catch (err) {
      console.error('Error fetching reminders:', err);
    }
  };

  const fetchResources = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/resources', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setResources(response.data);
    } catch (err) {
      console.error('Error fetching resources:', err);
    }
  };

  const fetchProgress = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/progress', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProgress(response.data);
    } catch (err) {
      console.error('Error fetching progress:', err);
    }
  };

  const addTask = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:5000/api/tasks', 
        { title: newTask },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setTasks([...tasks, response.data]);
      setNewTask('');
    } catch (err) {
      console.error('Error adding task:', err);
    }
  };

  const deleteTask = async (id) => {
    try {
      const token = localStorage.getItem('token');
      await axios.delete(`http://localhost:5000/api/tasks/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTasks(tasks.filter(task => task._id !== id));
    } catch (err) {
      console.error('Error deleting task:', err);
    }
  };

  const addReminder = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:5000/api/reminders', 
        { title: newReminder, date: new Date() },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setReminders([...reminders, response.data]);
      setNewReminder('');
    } catch (err) {
      console.error('Error adding reminder:', err);
    }
  };

  const deleteReminder = async (id) => {
    try {
      const token = localStorage.getItem('token');
      await axios.delete(`http://localhost:5000/api/reminders/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setReminders(reminders.filter(reminder => reminder._id !== id));
    } catch (err) {
      console.error('Error deleting reminder:', err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/signin');
  };

  const goToProfile = () => {
    navigate('/profile');
  };

  return (
    <div className="bg-background text-primary-foreground min-h-screen flex flex-col">
      <header className="h-30 fixed top-0 left-0 right-0 bg-gradient-to-r from-purple-500 to-indigo-500 py-4 px-6 flex justify-between items-center shadow-lg">
        <div className="flex items-center">
          <img src="/logo.png" alt="Logo" className="h-12 w-12 mr-3 rounded-full" />
          <h1 className="text-white text-2xl font-bold">Interview Preparation Dashboard</h1>
        </div>
        <div className="flex items-center">
          <button
            onClick={goToProfile}
            className="text-white text-2xl mr-6"
          >
            <FontAwesomeIcon icon={faUserCircle} />
          </button>
          <button
            onClick={handleLogout}
            className="text-white text-2xl"
          >
            <FontAwesomeIcon icon={faSignOutAlt} />
          </button>
        </div>
      </header>
      <main className="flex-grow flex flex-col items-center justify-center mt-40">
        <div className="w-full px-6 py-4">
          <div className="mb-8">
            <h2 className="text-xl font-bold mb-4">Tasks</h2>
            <div className="flex items-center mb-4">
              <input 
                type="text" 
                className="w-full px-4 py-2 border rounded-lg mr-2" 
                value={newTask}
                onChange={(e) => setNewTask(e.target.value)}
                placeholder="New Task"
              />
              <button
                onClick={addTask}
                className="bg-blue-500 text-white px-4 py-2 rounded-lg"
              >
                Add Task
              </button>
            </div>
            <ul>
              {tasks.map(task => (
                <li key={task._id} className="flex items-center justify-between mb-2">
                  <span>{task.title}</span>
                  <button
                    onClick={() => deleteTask(task._id)}
                    className="bg-red-500 text-white px-4 py-2 rounded-lg"
                  >
                    Delete
                  </button>
                </li>
              ))}
            </ul>
          </div>
          <div className="mb-8">
            <h2 className="text-xl font-bold mb-4">Reminders</h2>
            <div className="flex items-center mb-4">
              <input 
                type="text" 
                className="w-full px-4 py-2 border rounded-lg mr-2" 
                value={newReminder}
                onChange={(e) => setNewReminder(e.target.value)}
                placeholder="New Reminder"
              />
              <button
                onClick={addReminder}
                className="bg-blue-500 text-white px-4 py-2 rounded-lg"
              >
                Add Reminder
              </button>
            </div>
            <ul>
              {reminders.map(reminder => (
                <li key={reminder._id} className="flex items-center justify-between mb-2">
                  <span>{reminder.title}</span>
                  <button
                    onClick={() => deleteReminder(reminder._id)}
                    className="bg-red-500 text-white px-4 py-2 rounded-lg"
                  >
                    Delete
                  </button>
                </li>
              ))}
            </ul>
          </div>
          <div className="mb-8">
            <h2 className="text-xl font-bold mb-4">Resources</h2>
            <ul>
              {resources.map(resource => (
                <li key={resource._id} className="flex items-center justify-between mb-2">
                  <span>{resource.title}</span>
                </li>
              ))}
            </ul>
          </div>
          <div className="mb-8">
            <h2 className="text-xl font-bold mb-4">Progress</h2>
            <ul>
              {progress.map(prog => (
                <li key={prog._id} className="flex items-center justify-between mb-2">
                  <span>{prog.title}</span>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </main>
    </div>
  );
};

export default InterviewPreparationDashboard;
